import { Link, useMatch, useNavigate } from "react-router-dom";

function NavBar() {
    const navigate = useNavigate();
    const match = useMatch("/"); // Call useMatch once outside conditionals

    const links = [];
    if (!isLoggedIn()) {
        links.push(<Link to="/login" className={match("/login") ? "active" : ""}>Login</Link>);
    } else {
        links.push(<Link to="/expenses" className={match("/expenses") ? "active" : ""}>Expenses</Link>);
        links.push(<button onClick={logout} className="logout-btn">Logout</button>);
    }

    return (
        <nav className="navbar">
            <Link to="/" className={match("/") ? "active" : ""}>Home</Link>
            {links}
        </nav>
    );
}
